DESCRIPTION
Since the stratospheric success of the Squirtwoman series, Patrick Collins and William H. have thoroughly enjoyed themselves indulging in the squirting talents of a long list of gushing superstars: from Squirtwoman, Cytherea, to the delectable, squirt princess, Tiana Lynn, to porn super star, Flower Tucci, and her record selling series, 'Flower's Squirt Shower,' to the angelic, Angela Stone, and her gigantic eruptions that rival even Cytherea. These girls are the very best squirters the industry has ever seen and they are all featured in this compilation.
